import React from 'react';
import App from '../../App';

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from "react-router-dom"

const Rotas = () => {
    return(
        <Router>
            <Routes>
                <Route path='/'>
                    
                    <Link to="/projects" >projects</Link>
                </Route>
                <Route path='/projects'>"projects aq" </Route>
            </Routes>
        </Router>
    )  
}  

export default Rotas;
